PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "graph_states" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "snapshot" JSONB NOT NULL,
    "command" TEXT NOT NULL,
    "timestamp" TEXT NOT NULL DEFAULT '',
    "graphId" TEXT NOT NULL,
    CONSTRAINT "graph_states_graphId_fkey" FOREIGN KEY ("graphId") REFERENCES "graph_projects" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "graph_edges" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "source" TEXT NOT NULL,
    "target" TEXT NOT NULL,
    "label" TEXT,
    "type" TEXT,
    "data" JSONB,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "graphId" TEXT NOT NULL,
    CONSTRAINT "graph_edges_graphId_fkey" FOREIGN KEY ("graphId") REFERENCES "graph_projects" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "graph_nodes" (
    "id" TEXT NOT NULL,
    "label" TEXT NOT NULL,
    "type" TEXT NOT NULL,
    "data" JSONB NOT NULL,
    "position" JSONB NOT NULL,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "graphId" TEXT NOT NULL,

    PRIMARY KEY ("id", "graphId"),
    CONSTRAINT "graph_nodes_graphId_fkey" FOREIGN KEY ("graphId") REFERENCES "graph_projects" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "graph_projects" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "name" TEXT NOT NULL,
    "description" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL,
    "conversationId" TEXT NOT NULL,
    "conversationName" TEXT NOT NULL
);
CREATE UNIQUE INDEX "graph_nodes_id_graphId_key" ON "graph_nodes"("id", "graphId");
CREATE UNIQUE INDEX "graph_projects_conversationId_key" ON "graph_projects"("conversationId");
COMMIT;
